member.summary:
Gets or sets fetchXML is a proprietary query language that is used
in Microsoft Common Data Service for Apps (online &amp;
on-premises). Type: string (or Expression with resultType string).

Gets or sets additional options directly passed to SQL DW in Copy
Command. Type: key value pairs (value should be string type) (or
Expression with resultType object). Example: "additionalOptions": {
"MAXERRORS": "1000", "DATEFORMAT": "'ymd'" }

Gets or sets the private key from the .pem file that was generated
for your Xero private application. You must include all the text
from the .pem file, including the Unix line endings(
).
